import React from 'react';

import Card from '../Card/Card';
import classes from './Participante.module.css';

const participante = ( props ) => {
    const footer = props.endereco;
    return (
        <Card 
            img={props.img}
            nome={props.nome} 
            descr={props.descr}
            footer={footer}
        />
    );
};

export default participante;
